class Solution(object):
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        n,m,w=len(s),len(words),len(words[0])
        res=[]
        for k in xrange(n-m*w+1):
            seg=[s[i:i+w] for i in xrange(k,k+m*w,w)]
            for item in words:
                if item in seg: seg.remove(item)
                else: break
            if seg==[]: res.append(k)
        return res
        
